import headerLogo from "../images/Vector.svg";

function Header() {
  return (
    <header className="header">
      <img className="header__logo" src={headerLogo} alt="Логотип" />
      <Link to="/reviews">
        Войти
      </Link>
    </header>
  );
}

export default Header;
